PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "django_migrations" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "app" varchar(255) NOT NULL, "name" varchar(255) NOT NULL, "applied" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "auth_group_permissions" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "group_id" integer NOT NULL REFERENCES "auth_group" ("id") DEFERRABLE INITIALLY DEFERRED, "permission_id" integer NOT NULL REFERENCES "auth_permission" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "auth_user_groups" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "user_id" integer NOT NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED, "group_id" integer NOT NULL REFERENCES "auth_group" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "auth_user_user_permissions" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "user_id" integer NOT NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED, "permission_id" integer NOT NULL REFERENCES "auth_permission" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "django_admin_log" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "object_id" text NULL, "object_repr" varchar(200) NOT NULL, "action_flag" smallint unsigned NOT NULL CHECK ("action_flag" >= 0), "change_message" text NOT NULL, "content_type_id" integer NULL REFERENCES "django_content_type" ("id") DEFERRABLE INITIALLY DEFERRED, "user_id" integer NOT NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED, "action_time" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "django_content_type" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "app_label" varchar(100) NOT NULL, "model" varchar(100) NOT NULL);
CREATE TABLE IF NOT EXISTS "auth_permission" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "content_type_id" integer NOT NULL REFERENCES "django_content_type" ("id") DEFERRABLE INITIALLY DEFERRED, "codename" varchar(100) NOT NULL, "name" varchar(255) NOT NULL);
CREATE TABLE IF NOT EXISTS "auth_group" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(150) NOT NULL UNIQUE);
CREATE TABLE IF NOT EXISTS "auth_user" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "password" varchar(128) NOT NULL, "last_login" datetime NULL, "is_superuser" bool NOT NULL, "username" varchar(150) NOT NULL UNIQUE, "last_name" varchar(150) NOT NULL, "email" varchar(254) NOT NULL, "is_staff" bool NOT NULL, "is_active" bool NOT NULL, "date_joined" datetime NOT NULL, "first_name" varchar(150) NOT NULL);
CREATE TABLE IF NOT EXISTS "critical_items" ("item_id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(100) NOT NULL, "purchase_limit" integer NOT NULL, "limit_period" varchar(20) NOT NULL, "allowed_purchase_day" varchar(20) NULL, "created_at" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "merchants" ("merchant_id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "business_license" varchar(255) NOT NULL UNIQUE, "name" varchar(100) NOT NULL, "address" varchar(255) NOT NULL, "created_at" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "government_officials" ("official_id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "role" varchar(50) NOT NULL, "created_at" datetime NOT NULL, "user_id" integer NOT NULL UNIQUE REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "access_logs" ("log_id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "action" varchar(100) NOT NULL, "timestamp" datetime NOT NULL, "official_id" integer NOT NULL REFERENCES "government_officials" ("official_id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "merchant_stock" ("stock_id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "stock_level" integer NOT NULL, "last_updated" datetime NOT NULL, "item_id" integer NOT NULL REFERENCES "critical_items" ("item_id") DEFERRABLE INITIALLY DEFERRED, "merchant_id" integer NOT NULL REFERENCES "merchants" ("merchant_id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "django_session" ("session_key" varchar(40) NOT NULL PRIMARY KEY, "session_data" text NOT NULL, "expire_date" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "vaccination_records" ("record_id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "vaccine_type" varchar(100) NOT NULL, "manufacturer" varchar(100) NULL, "dose_number" integer NOT NULL, "batch_number" varchar(50) NULL, "vaccination_date" date NOT NULL, "administered_by" varchar(100) NULL, "status" varchar(20) NOT NULL, "created_at" datetime NOT NULL, "prs_id_id" varchar(50) NOT NULL REFERENCES "individuals" ("prs_id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "purchases" ("purchase_id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "quantity" integer NOT NULL, "purchase_date" datetime NOT NULL, "status" varchar(20) NULL, "item_id" integer NOT NULL REFERENCES "critical_items" ("item_id") DEFERRABLE INITIALLY DEFERRED, "merchant_id" integer NOT NULL REFERENCES "merchants" ("merchant_id") DEFERRABLE INITIALLY DEFERRED, "prs_id_id" varchar(50) NOT NULL REFERENCES "individuals" ("prs_id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "individuals" ("national_identifier" varchar(255) NOT NULL, "date_of_birth" date NOT NULL, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL, "prs_id" varchar(50) NOT NULL PRIMARY KEY);
CREATE TABLE IF NOT EXISTS "user_profiles" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "prs_id_id" varchar(50) NULL REFERENCES "individuals" ("prs_id") DEFERRABLE INITIALLY DEFERRED, "user_id" integer NOT NULL UNIQUE REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED, "merchant_id_id" integer NULL REFERENCES "merchants" ("merchant_id") DEFERRABLE INITIALLY DEFERRED);
